function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]

    const [lang, setLang] = useState(false)

  return (
    <div>
        <div className='navbar'>
            <logo>
                <img src="/images/syndico.png" />
            </logo>
            <ul>
                {/* {nav.map((item,key)=>(
                    <li key={key+1}> <h3> {item.title} </h3> </li>
                ))} */}
                <li onClick={()=> setLang(!lang)}> <i class="fa-solid fa-globe"></i> </li>
            </ul>
        </div>

        {lang?<div className='langs'>
            <ul>
            {langs.map((lang,key)=>(
                <li><h4> {lang.sub} </h4> </li>
            ))}
            </ul>
        </div> : ""}
    </div>
  )
}

export default Navbar
